description:
Jade Dream - Daddy's Worst Nightmare
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Walking home one day, Jade decided she was in need of a real treat, what was on her mind was something like some giant meat. She ran into a brother who was hung like no other, it was so big when he pushed it in she screamed and she suffered. Poor little Jade can't walk right anymore, and this goes to prove that Daddy's worse nightmare is turning his girl into our little whore!

